import { AppBar } from '@material-ui/core';
import Toolbar from 'material-ui/Toolbar';
import IconButton from 'material-ui/IconButton';
import Badge from 'material-ui/Badge';
import MenuIcon from 'material-ui-icons/Menu';
import NotificationsIcon from 'material-ui-icons/Notifications';
import HelpIcon from 'material-ui-icons/HelpOutline';

const Demo = () => (
    <AppBar>
      <Toolbar>
        <IconButton color="contrast" aria-label="Menu">
          <MenuIcon />
        </IconButton>
        <span style={inlineStyles.spacer}></span>
        <IconButton color="contrast" aria-label="Notifications">
          <Badge style={inlineStyles.badgeFix} badgeContent={5} color="accent">
            <NotificationsIcon />
          </Badge>
        </IconButton>
        <IconButton color="contrast" aria-label="Notifications">
          <Badge badgeContent={5} color="accent">
            <NotificationsIcon />
          </Badge>
        </IconButton>
        <IconButton color="contrast" aria-label="Help">
          <HelpIcon />
        </IconButton>
      </Toolbar>
    </AppBar>
  );

  export const Home = () => {
      return (
          <div>
             <Demo/> 
          </div>
      )
  }
